import matplotlib.pyplot as plt

def generic_plot(x, y, title, xlabel, ylabel):
  plt.suptitle(title)
  plt.plot(x, y, marker="")
  plt.xlabel(xlabel)
  plt.ylabel(ylabel)
  ax = plt.gca() #get current axes
  for side in ['right','top']:
    ax.spines[side].set_visible(False)
  return plt

def generic_plot_color(x, y, title, xlabel, ylabel, ms="", ls="", col=""):
  plt.suptitle(title)
  if (col == ""):
    plt.plot(x, y, linestyle=ls, marker=ms)
  else:
    plt.plot(x, y, linestyle=ls, marker=ms, color=col)
  plt.xlabel(xlabel)
  plt.ylabel(ylabel)
  ax = plt.gca() #get current axes
  for side in ['right','top']:
    ax.spines[side].set_visible(False)
  return plt

def num_entries_above_bit_security_level(l, b):
  return next(e[0] for e in enumerate(l) if e[1] < -b) # how many entries are larger than bit security level

